import React, { useState } from 'react';

const ManageArtworks = () => {
  const [artworks, setArtworks] = useState([]);
  
  const addArtwork = () => {
    // Placeholder logic for adding new artwork
    console.log('New artwork added');
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1 style={{ fontSize: '24px', marginBottom: '15px' }}>Manage Artworks</h1>
      <button 
        onClick={addArtwork} 
        style={{ margin: '10px 0', padding: '10px 15px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}
      >
        Add New Artwork
      </button>
      <ul style={{ listStyleType: 'none', padding: '0' }}>
        {artworks.map((artwork, index) => (
          <li key={index} style={{ padding: '8px', border: '1px solid #ddd', borderRadius: '4px', marginBottom: '10px' }}>{artwork.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default ManageArtworks1;
